import React from "react";
import styled from 'styled-components';

const HexagonShape = styled.div`
	float: left;
    margin-right: -26px;
    margin-bottom: -50px;

    color: ${props => props.this.state === 'info' ? '#e6e6e6' : '#fff'};
`;

export default function Hexagon(props) {
	return <HexagonShape>{props.children}</HexagonShape>;
}
